import games from './games.json'

function ListMovies() {
    return(
        <div>
            games.map((game) => (
          <div key={game.name} className="col-md-4">
            <Image src={game.imageUrl} alt={game.name} width="128" height="181" />
          </div>
            )
        </div>
    )
}

export default ListMovies;
